import React, {Component} from 'react';
import {Card, Button, Row, Col} from 'react-bootstrap';

export class Plant extends React.Component {
    render() {
        return (
            <Card>
                <Row>
                    <Col lg={4}>
                        {/* <img src={this.props.img} alt="drawing of plant" /> */}
                        <img src="https://raw.githubusercontent.com/annazhoufast/plantastic/main/data/imgs/tomatoe.png?token=ALLXA25BKVLL7A7AEQS3W3LASHPF6" 
                            alt="drawing of plant"
                            className="img-100" />
                    </Col>
                    <Col lg={8}>
                        <Card.Body>
                            <Card.Title>
                                {/* {this.props.pName} */}
                                Tomatoes
                            </Card.Title>
                            <Card.Text>
                                <p>Harvest Total</p>
                                <p>3</p>
                                <br/>
                                <p>Carbon Emissions Saved</p>
                                <p>357 g</p>
                            </Card.Text>
                        </Card.Body>

                    </Col>
                </Row>
            </Card>
        )
    }
}
